import React, {useState, useEffect} from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import './Layout.scss'
import {
    DesktopOutlined,
    PieChartOutlined,
    FileOutlined,
    TeamOutlined,
    UserOutlined,
} from '@ant-design/icons';
import {getPeople} from "../../redux/session/MainReducer";
import {useDispatch, useSelector} from "react-redux";
import ItemCard from "./ItemCard/ItemCard";

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

const MainLayout = () => {
    useEffect(() => {
        getPeople()(dispatch)

    }, [])
    const dispatch = useDispatch();
    const {people} = useSelector((people) => people);
    console.log(12, people)


    const [collapsed, setCollapsed] = useState(false)

    const onCollapse = () => {
        setCollapsed(prevState => !prevState)
    };
    return (
        <Layout style={{ minHeight: '100vh' }}>
            <Sider collapsible collapsed={collapsed} onCollapse={onCollapse}>
                <div className="logo" />
                <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
                    <Menu.Item key="1">
                        People
                    </Menu.Item>
                    <Menu.Item key="2">
                        Plenets
                    </Menu.Item>
                    <Menu.Item key="3">
                        Starships
                    </Menu.Item>
                </Menu>
            </Sider>
            <Layout className="site-layout">
                <Header className="site-layout-background"
                        style={{ padding: 0, color: '#fff', textAlign: 'center' }}
                >
                    React APP by Roman
                </Header>
                <Content style={{ margin: '0 16px' }}>
                    <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
                        <div className="content-wrapper">
                            {
                                people?.length > 0 && people.map(item => {
                                    return <ItemCard
                                        item={item}
                                        key={item.url}
                                    />
                                })
                            }
                        </div>
                    </div>
                </Content>
                <Footer style={{ textAlign: 'center' }}>Roman Demianchuk, 2021</Footer>
            </Layout>
        </Layout>

    );
}

export default MainLayout;
